import {connect} from 'react-redux'
const List = (props) => (
          <div>
          <OrderedList >
          {props.todos
            .sort(function(x,y){
              return y.id-x.id
            })
            .map(todo => <Todo key={todo.id} todo = {todo.item}  />)};
            {console.log(props)}

          </OrderedList>
        </div>
);



